import Img from 'react-image';
import '../components/index.css'

class App extends React.Component{
    render(){
        return(
            <div>
                <h1>Winter Special</h1>
                <div className="ui row">
                  <div className="ui column" > 
                    <Img src="https://images.pexels.com/photos/691668/pexels-photo-691668.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"  style={{width:"90%"}}/>
                 </div>
                 <div className="ui column" >
                <Img src="https://images.pexels.com/photos/753626/pexels-photo-753626.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500" style={{width:"90%"}}/>
                </div>
                <div className="ui column">
                <Img src="https://images.pexels.com/photos/459225/pexels-photo-459225.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500" style={{width:"90%"}}/>
                </div>
                </div>
                <h1>Fa,</h1>
            </div>
        );
    }
}

export default App;
